pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155Receiver.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./interfaces/IGenMarketPlaceFactory.sol";

contract GenMarketPlace is ERC1155Receiver {
    using SafeMath for uint;

    address public genTicket;

    uint256[] public prices;
    uint256[] public numTicketsTransferable;
    IGenMarketPlaceFactory public factory;
    address public creator;
    bool public active = false;
    bool public allow = false;
    bool public enable = false;
    mapping(uint256 => mapping(address => uint256)) public purchases;
    mapping(uint256 => uint256) public ticketsPurchased;
    uint256[] public ticketsRemaining;

    struct Listing {
        uint256 sprice;
        address seller;
        bool listed;
    }

    // mapping(gt => mapping(id => mapping(seller => Listing))) public listings;
    mapping(address => mapping(uint256 => mapping(address => Listing))) public listings;


    bytes private constant VALIDATOR = bytes('JC');

    constructor (
        address _genTicket,
        uint256[] memory _prices,
        uint256[] memory _numTicketsTransferable,
        IGenMarketPlaceFactory _factory,
        address _creator
    ) 
        public 
    {
        genTicket = _genTicket;
        prices = _prices;
        numTicketsTransferable = _numTicketsTransferable;
        factory = _factory;
        creator = _creator;
        ticketsRemaining = numTicketsTransferable;
    }

    function ticketTypes() external view returns (uint) {
        return numTicketsTransferable.length;
    }

    // To allow buyer to deposit bought tickets to _to address
    function depositBoughtTickets (address _to, uint256 _id, uint256 _amount) external {
        require(allow, "GenMarketPlace: The operation is not allowed yet");
        require(IERC1155(genTicket).balanceOf(msg.sender, _id) > 0, "GenMarketPlace: The ticket is not owned by Caller");
        IERC1155(genTicket).safeTransferFrom(msg.sender, _to, _id, _amount, VALIDATOR);
    }

    // to batch transfer NFTs to _to address eg (0x_to, [0,5,0,3])
    function transferTickets(address _to, uint256[] memory _numTicketsToTransfer) external {
        require(allow, "GenMarketPlace: The operation is not allowed yet");
        uint256[] memory tokenIDs = new uint256[](_numTicketsToTransfer.length);
        for (uint8 i=0; i < _numTicketsToTransfer.length; i++) {
            tokenIDs[i] = i;
        }
        IERC1155(genTicket).safeBatchTransferFrom(msg.sender, _to, tokenIDs, _numTicketsToTransfer, VALIDATOR);
    }

    function deposit () external {
        require(msg.sender == creator, "GenMarketPlace: Only the creator can deposit the tickets");
        require(!active, "GenMarketPlace: Market is already active");
        uint256[] memory tokenIDs = new uint256[](numTicketsTransferable.length);
        for (uint8 i = 0; i < numTicketsTransferable.length; i++)
            tokenIDs[i] = i;
        IERC1155(genTicket).safeBatchTransferFrom(msg.sender, address(this), tokenIDs, numTicketsTransferable, VALIDATOR);

        active = true;
    }

    function buy(uint256 _id, uint256 _amount) external payable {
        require(active, "GenMarketPlace: Market place is not active");
        require(ticketsPurchased[_id].add(_amount) <= numTicketsTransferable[_id], "GenMarket: Not enough tickets remaining");
        require(prices[_id].mul(_amount) <= msg.value, "GenMarket: Insufficient payment");

        purchases[_id][msg.sender] = purchases[_id][msg.sender].add(_amount);
        ticketsPurchased[_id] = ticketsPurchased[_id].add(_amount);
        ticketsRemaining[_id] = numTicketsTransferable[_id].sub(ticketsPurchased[_id]);

        if (factory.feeTo() != address(0)) {
            // Send fees to fee address
            (bool sent, bytes memory data) = factory.feeTo().call{value: msg.value.div(factory.feeDivisor())}("");
            require(sent, "GenMarket: Failed to send Ether");
        }

        bytes memory data;
        IERC1155(genTicket).safeTransferFrom(address(this), msg.sender, _id, _amount, data);
    }

    // if at all we want to take back the remaining NFTs from this contract
    // call only once
    function transferUnsoldTickets() external {
        require(msg.sender == creator, "GenMarket: Only the creator can transfer");
        require(!active, "GenMarket: Market is active");

        uint256[] memory tokenIDs = new uint256[](numTicketsTransferable.length);

        for (uint8 i=0; i < numTicketsTransferable.length; i++) {
            tokenIDs[i] = i;
        }
        IERC1155(genTicket).safeBatchTransferFrom(address(this), msg.sender, tokenIDs, ticketsRemaining, VALIDATOR);      
    }

    // to make market place active
    function flipMarketStatus() external {
        require(msg.sender == creator, "GenMarket: Only the creator can flip the market status");
        active = !active;
    }

    // to allow buyers to deposit their tickets
    function flipAllowStatus() external {
        require(msg.sender == creator, "GenMarket: Only the creator can flip the allow deposit status");
        allow = !allow;
    }

    // to enable users to list their tickets on market place
    function flipEnableStatus() external {
        require(msg.sender == creator, "GenMarket: Only the creator can flip enable list status");
        enable = !enable;
    }

    function addListing(uint256 _id, uint256 sprice) external {
        require(enable, "GenMarketPlace: Market place does not allow listing yet");
        Listing memory item = listings[genTicket][_id][msg.sender];
        require(IERC1155(genTicket).balanceOf(msg.sender, _id) > 0, "GenMarketPlace: The ticket is not owned by Caller");

        if (item.listed == true){
            require(sprice <= item.sprice, "GenMarketPlace: The new sale price must be lower than the current price. If you need to set a higher price, cancel the listing and re-list.");
        }

        listings[genTicket][_id][msg.sender] = Listing(sprice, msg.sender, true);
    }

    function cancelListing(uint256 _id) external {
        Listing memory item = listings[genTicket][_id][msg.sender];
        require(item.seller == msg.sender, "GenMarketPlace: The caller is not the seller");
        require(item.listed == true, "GenMarketPlace: The item is not listed for sale");
        require(IERC1155(genTicket).balanceOf(msg.sender, _id) > 0, "GenMarketPlace: The ticket is not owned by Caller");

        listings[genTicket][_id][msg.sender] = Listing(item.sprice, msg.sender, false);
    }

    function purchase(uint256 _id, uint256 _amount, address _seller) external payable {
        Listing memory item = listings[genTicket][_id][_seller];
        require(item.listed == true, "GenMarketPlace: The item is not listed for sale");
        require(IERC1155(genTicket).balanceOf(item.seller, _id) >= _amount, "GenMarketPlace: Not enough tickets presented/listed from Seller");
        // require(IERC1155(genTicket).isApprovedForAll(msg.sender, address(this)), "GenMarketPlace: Not approved to GenTickets");
        require(item.sprice.mul(_amount) <= msg.value, "GenMarketPlace: Insufficient payment");

        if(factory.feeMultiplier() >= 0){
        (bool sent, bytes memory data) = item.seller.call{value: (msg.value - msg.value.mul(factory.feeMultiplier()).div(10**18).div(100))}("");
        require(sent, "GenMarket: Failed to send Ether");
        }

        listings[genTicket][_id][msg.sender] = Listing(0, address(0), false);

        bytes memory data;
        IERC1155(genTicket).safeTransferFrom(item.seller, msg.sender, _id, _amount, data);

        if (IERC1155(genTicket).balanceOf(item.seller, _id) == 0){
            listings[genTicket][_id][item.seller] = Listing(0, address(0), false);
        }

    }

    function claim() external {
        require(msg.sender == creator, "GenMarketPlace: Only the creator can claim");

        (bool sent, bytes memory data) = msg.sender.call{value: address(this).balance}("");
        require(sent, "GenMarket: Failed to send Ether");
    }

    function getBlockTimestamp() internal view returns (uint) {
        // solium-disable-next-line security/no-block-members
        return block.timestamp;
    }

    /**
     * ERC1155 Token ERC1155Receiver
     */
    function onERC1155Received(address _operator, address _from, uint256 _id, uint256 _value, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xf23a6e61;
        }
    }

    function onERC1155BatchReceived(address _operator, address _from, uint256[] calldata _ids, uint256[] calldata _values, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xbc197c81;
        }
    }
}
